a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0430\u044f \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BA%D0%BB%D0%B8%D1%87,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0435\u043a\u043b\u0438\u0447, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0424\u0438\u043b\u0438\u043f\u043f\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430 \u0412\u0435\u043a\u043b\u0438\u0447\u0430<\/a>   \u0438 \u0412\u0430\u0441\u0438\u043b\u0438\u044f \u0414\u044c\u044f\u043a\u043e\u043d\u043e\u0432\u0430 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984\" class=\"mw-redirect\" title=\"1984\">1984<\/a>&#160;\u2014 \u0413\u043e\u043b\u043e\u0432\u043d\u0430\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D0%B5_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B8_%D0%BF%D1%80%D0%BE%D0%B5%D0%BA%D1%82%D0%B0_971_%C2%AB%D0%A9%D1%83%D0%BA%D0%B0-%D0%91%C2%BB\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u0435 \u043b\u043e\u0434\u043a\u0438 \u043f\u0440\u043e\u0435\u043a\u0442\u0430 971 \u00ab\u0429\u0443\u043a\u0430-\u0411\u00bb\">\u0429\u0443\u043a\u0430-\u0411<\/a>\u00bb, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A-284\" class=\"mw-redirect\" title=\"\u041a-284\">\u041a-284<\/a>, \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0432 \u0441\u0442\u0440\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%92%D0%9C%D0%A4_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u0412\u041c\u0424 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u043e\u0433\u043